import { useSelector, useDispatch } from "react-redux";
import initialDetails from "../data/initialDetails";
import HeaderTailwind from "./header";
import Search from "./search";
import store from "../store";

export default function SearchScreen() {
  const { dispatch } = store;
  const { events } = useSelector((state) => state.events);

  useEffect(() => {
    fetchAllData();
  }, []);

  const fetchAllData = useCallback(async (isRefresh = false) => {
    dispatch({ type: "events/list" });
  });

  return (
    <div className="h-screen w-screen">
      <HeaderTailwind></HeaderTailwind>

      <button
        onClick={() => {
          console.log(events);
        }}
        className="bg-blue-700 border-2 font-bold text-gray-200 px-4 py-2 absolute top-40 right-20 rounded-2xl"
      >
        click me
      </button>
      <Search details={events} />
    </div>
  );
}
